import instance from "../../api/api";
import { useEffect, useState } from "react";

const Test = () => {
  const [data, setData] = useState([]);

  const getData = () => {
    instance.get("/cmmn/findAll").then((res) => console.log(res));
    setData(res.data);
  };
  useEffect(() => {
    getData();
  }, []);
  return <div>test</div>;
};

export default Test;
